import React, { Component } from "react";
import {Form ,Modal ,Col ,Row ,Button} from 'react-bootstrap';

function MyVerticallyCenteredModal(props) {
    return (
        <Modal
            {...props}
            size="lg"
            aria-labelledby="contained-modal-title-vcenter"
            centered
        >
            <Modal.Header closeButton>
                <Modal.Title id="contained-modal-title-vcenter">
                    Modal heading
                </Modal.Title>
            </Modal.Header>
            <Modal.Body>
                <h4>Centered Modal</h4>
                <p>
                    Cras mattis consectetur purus sit amet fermentum. Cras justo odio,
                    dapibus ac facilisis in, egestas eget quam. Morbi leo risus, porta ac
                    consectetur ac, vestibulum at eros.
                </p>
            </Modal.Body>
            <Modal.Footer>
                <Button onClick={props.onHide}>Close</Button>
            </Modal.Footer>
        </Modal>
    );
}
function Wallets()
{
    const [modalShow, setModalShow] = React.useState(false);


        return (

            <div style={{backgroundColor:'#FFE4E1'}} className="text-center page-holder bg-cover">
                <br/><br/><br/>
                <header>
                    <h1><b> Manage Wallets </b></h1>
                </header>

                <header className="text-center text-white py-5">
                <div className="container">

                                <Button className="btn floatleft btn-xxl"  onClick={() => setModalShow(true)} variant="secondary" size="lg" style={{fontsize:'250px'}}>Add a Wallet</Button>

                                <Button className="btn floatright btn-xxl" onClick={() => setModalShow(true)} variant="secondary" size="lg" >Delete a Wallet</Button>

                </div>
                </header>







            </div>
        );


}
export default Wallets;
